import React, { useState } from "react";
import { useHistory } from "react-router-dom";

const StudentSignup = () => {
  const [step, setStep] = useState(1); // Initial step is 1
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  // Additional fields for the second step
  const [researchInterests, setResearchInterests] = useState("");
  const [levelOfEducation, setLevelOfEducation] = useState("");
  const [skills, setSkills] = useState("");
  const [experience, setExperience] = useState("");
  const [fieldOfStudy, setFieldOfStudy] = useState("");

  const handleNext = () => {
    // Validate the required fields before proceeding to the next step
    if (step === 1 && !firstName && !lastName && !email && !password) {
      alert("Please fill in all required fields.");
      return;
    }

    // Move to the next step
    setStep(step + 1);
  };

  const handleSubmit = () => {
    // Perform form submission logic here
    console.log("Form submitted!");
    console.log({
      firstName,
      lastName,
      email,
      password,
      researchInterests,
      levelOfEducation,
      skills,
      experience,
      fieldOfStudy,
    });
  };

  // Display a success message
  alert("Profile created!");

  // Redirect to the explore page
  history.push("/explore");

  return (
    <div>
      {step === 1 && (
        <div>
          <h2>Step 1: Personal Information</h2>
          <form>
            {/* First Name */}
            <div>
              <label>
                First Name:
                <input
                  type="text"
                  value={firstName}
                  onChange={(e) => setFirstName(e.target.value)}
                  required
                />
              </label>
            </div>
            {/* Last Name */}
            <div>
              <label>
                Last Name:
                <input
                  type="text"
                  value={lastName}
                  onChange={(e) => setLastName(e.target.value)}
                  required
                />
              </label>
            </div>
            {/* Email */}
            <div>
              <label>
                Email:
                <input
                  type="email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  required
                />
              </label>
            </div>
            {/* Password */}
            <div>
              <label>
                Password:
                <input
                  type="password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required
                />
              </label>
            </div>
            {/* Next button */}
            <div>
              <button type="button" onClick={handleNext}>
                Next
              </button>
            </div>
          </form>
        </div>
      )}

      {step === 2 && (
        <div>
          <h2>Step 2: Additional Information</h2>
          <form onSubmit={handleSubmit}>
            {/* Research Interests */}
            <div>
              <label>
                Research Interests:
                <input
                  type="text"
                  value={researchInterests}
                  onChange={(e) => setResearchInterests(e.target.value)}
                />
              </label>
            </div>
            {/* Level of Education */}
            <div>
              <label>
                Level of Education:
                <input
                  type="text"
                  value={levelOfEducation}
                  onChange={(e) => setLevelOfEducation(e.target.value)}
                />
              </label>
            </div>
            {/* Skills */}
            <div>
              <label>
                Skills:
                <input
                  type="text"
                  value={skills}
                  onChange={(e) => setSkills(e.target.value)}
                />
              </label>
            </div>
            {/* Experience */}
            <div>
              <label>
                Experience:
                <input
                  type="text"
                  value={experience}
                  onChange={(e) => setExperience(e.target.value)}
                />
              </label>
            </div>
            {/* Field of Study */}
            <div>
              <label>
                Field of Study:
                <input
                  type="text"
                  value={fieldOfStudy}
                  onChange={(e) => setFieldOfStudy(e.target.value)}
                />
              </label>
            </div>
            {/* Submit button */}
            <div>
              <button type="submit">Submit</button>
            </div>
          </form>
        </div>
      )}
    </div>
  );
};

export default StudentSignup;
